import collections
import itertools
from typing import Dict, List

from icontract import require, ensure, DBC


class Mapping(DBC):
    """Represent a mapping."""

    @require(lambda mapping: all(key in mapping for key in ['0', '1']))
    @require(lambda mapping: all(value in ['0', '1'] for value in mapping.values()))
    def __init__(self, mapping: Dict[str, str]) -> None:
        """Initialize with a mapping."""
        self.mapping = mapping

    def __repr__(self) -> str:
        """Represent the mapping as a string."""
        return f'Mapping({self.mapping!r})'


class Colors(DBC):
    """Represent the color of a character."""

    @require(lambda mapping: all(key in mapping for key in ['0', '1']))
    @require(lambda mapping: all(value in ['0', '1'] for value in mapping.values()))
    def __init__(self, mapping: Dict[str, str]) -> None:
        """Initialize the colors."""
        self.coloring = mapping

    def __repr__(self) -> str:
        """Represent the colors as a string."""
        return f'Colors({self.coloring!r})'


class Fmt(DBC):
    """Represent a fmt string."""

    @require(lambda fmt: all(char in '0' for char in fmt))
    @require(lambda fmt: all(fmt[i] < fmt[i + 1] for i in range(len(fmt) - 1)))
    def __init__(self, fmt: str) -> None:
        """Initialize with a fmt string."""
        self.fmt = fmt

    def __repr__(self) -> str:
        """Represent the fmt string as a string."""
        return f'Fmt({self.fmt!r})'


class Fmts(DBC):
    """Represent all valid fmt strings."""

    def __init__(self, fmts: List[Fmt]) -> None:
        """Initialize with a list of all valid fmt strings."""
        self.fmts = fmts

    def __repr__(self) -> str:
        """Represent the fmt strings as a string."""
        return f'Fmts({self.fmts!r})'


class Swaps(DBC):
    """Represent swaps made on a mapping."""

    @require(lambda mapping: all(key in mapping for key in ['0', '1']))
    @require(lambda mapping: all(value in ['0', '1'] for value in mapping.values()))
    def __init__(self, mapping: Dict[str, str], swaps: List[Tuple[str, str]]) -> None:
        """Initialize with a mapping and swaps."""
        self.mapping = mapping
        self.swaps = swaps

    def __repr__(self) -> str:
        """Represent the swaps as a string."""
        return f'Swaps({self.mapping!r}, {self.swaps!r})'


class Mappings(DBC):
    """Represent all mappings from a string to a color."""

    @require(lambda string: all(char in string for char in 'ab'))
    @require(lambda string: len(string) == len(set(string)))
    def __init__(self, string: str) -> None:
        """Initialize with a string."""
        self.string = string

    def __repr__(self) -> str:
        """Represent the mapping as a string."""
        return f'Mappings({self.string!r})'


class Solution:
    """Solve the problem."""

    @require(lambda string: len(string) > 1)
    @require(lambda string: all(char in string for char in 'ab'))
    @require(lambda string: len(string) == len(set(string)))
    def solve(self, string: str) -> bool:
        """Solve."""
        return self.__help(string)

    @require(lambda mappings: all(mappings[i]!= mappings[j] for i, j in itertools.combinations(mappings, 2)))
    def __help(self, mappings: Mappings) -> bool:
        """Evaluate the string."""

        coloring = dict()  # type: Dict[str, str]
        for char in mappings.string:
            coloring[char] = '1' if char in 'ab' else '0'

        mapping = Mapping(coloring)

        swaps = list()  # type: List[Tuple[str, str]]
        for old, new in itertools.combinations(coloring, 2):
            if coloring[old]!= coloring[new]:
                swaps.append((old, new))
                coloring[old] = coloring[new]
                coloring[new] = '1' if coloring[new] == '0' else '0'

        mapping = Mapping(coloring)
        return Swaps(mapping, swaps).can_be_sorted()

