class Solution:
    def get_median_count(self, n: int, m: int, a: List[int]) -> int:
        # assume median is unique
        # so if median is in list, the count is the same as when it appears once
        c = Counter(a)
        median = (n + 1) // 2
        return c[m] if m in c else 0

    def get_median_count2(self, n: int, m: int, a: List[int]) -> int:
        c = Counter(a)
        a = sorted(a)
        median = (n + 1) // 2
        if m in c:
            count = c[m]
            start = 0
            end = n - 1
            while True:
                if start == end:
                    break
                mid = (start + end) // 2
                if m == a[mid]:
                    count += 1
                    break
                elif m < a[mid]:
                    end = mid - 1
                else:
                    start = mid + 1
            if count % 2:
                # odd
                return (end + 1 - start) // 2
            else:
                # even
                return (end + 1 - start) // 2 + 1
        else:
            # m not in a
            left = 0
            right = n - 1
            while True:
                if left == right:
                    break
                mid = (left + right) // 2
                if a[mid] >= m:
                    right = mid
                else:
                    left = mid + 1
            if m < a[left]:
                return left
            else:
                return left + 1

