class Solution:
    def pascalTriangle(self, n):
        """
        :type n: int
        :rtype: List[List[int]]
        """
        return self.pascal_triangle_recursion(n, [])

    def pascal_triangle_recursion(self, n, result):
        if n == 1:
            return [1]
        elif n == 0:
            return []
        else:
            row = [1]
            previous_row = self.pascal_triangle_recursion(n-1, result)
            for i in range(1, len(previous_row)):
                row.append(previous_row[i] + previous_row[i-1])
            row.append(1)
            result.append(row)
            return row

    def pascal_triangle_dp(self, n):
        dp = [[0 for j in range(i+1)] for i in range(n)]
        dp[0][0] = 1

        for i in range(n):
            for j in range(i+1):
                if j == 0:
                    dp[i][j] = 1
                else:
                    dp[i][j] = dp[i-1][j-1] + dp[i-1][j]
        return dp

