class Solution:
    def solution(self, stdin):
        N = int(stdin.readline())
        A = [int(i) for i in stdin.readline().split()]

        A = [0] + A + [N+1]

        stack = [0]
        res = []

        for i in range(1, N+2):
            if A[i] > stack[-1]:
                while stack and A[i] > A[stack[-1]]:
                    res.append(stack.pop())
                stack.append(i)

            elif A[i] < stack[-1]:
                stack.append(i)

        return "\n".join(map(str, res))

